script: |
  super -f text -I q8321.spq | sort > q8321.out

inputs:
  - name: q8321.spq
    data: |
      SELECT DISTINCT + ( - col2 ) - + col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 6 * - col0 IS NULL;
  - name: tab1

outputs:
  - name: q8321.out
    data: |
      -144
      -147
      -159
